import "../assets/css/modeToggle.css";

function ModeToggle({ mode, toggleDarkMode }) {
  let toggleText = "Dark Mode";

  if (mode) {
    toggleText = "Light Mode";
  }

  return (
    <div>
      <button className="toggleButton">{toggleText}</button>
    </div>
  );
}

export default ModeToggle;
